/* Pallete to test new combinations with
	rgb(147,223,184)
	rgb(235,220,200)
	rgb(238,237,219)
	rgb(227,170,214)
	rgb(181,216,235)
	rgb(238,242,230)
	rgb(255,237,201)
	rgb(255,200,186)
	rgb(37,41,42)
	rgb(161,219,178)
	rgb(230,230,220)
	rgb(218,221,251)
	rgb(248,218,251)
	rgb(255,171,171)
	rgb(15,219,159)
	rgb(218,251,248)
	rgb(221,229,254)
	rgb(226,255,230)
*/
.github-Blank {
  display: flex;
  flex-direction: column;
  justify-content: center;
  width: 100%;
  height: 100%;
}
.github-Blank-body {
  flex-grow: 1;
  display: flex;
  flex-direction: column;
  justify-content: center;
}
.github-Blank-footer {
  flex-shrink: 0;
  padding: 20px 10px;
}
.github-Blank-LargeIcon:before {
  margin-right: 0;
  margin-top: 50px;
  margin-bottom: 50px;
  width: auto;
  height: auto;
  font-size: 8em;
  color: #555759;
}
.github-Blank-banner,
.github-Blank-context,
.github-Blank-explanation,
.github-Blank-LargeIcon {
  text-align: center;
}
.github-Blank-option {
  display: flex;
  flex-direction: row;
  align-items: center;
}
.github-Blank-option--explained {
  margin-bottom: 5px;
}
.github-Blank-actionBtn {
  flex: 1;
  margin: 0 10%;
}
.github-Blank-explanation {
  margin-left: 5%;
  margin-right: 5%;
  color: #555;
}
.github-Blank-tabLink {
  margin-left: 0.5em;
  border-color: inherit;
  background-color: inherit;
  border-style: none;
  border-width: 0;
  padding: 0;
  text-decoration: underline;
}
.github-Blank-tabLink .icon {
  padding-right: 0;
}
